Bumps ssh2-streams from 0.4.4 to 0.4.5.

Commits

6fc95d3 bump version
c5f7b86 SFTPStream: fix advancing of read position
5b8d1a0 lib: change eddsa support check
8871806 SSH2Stream: fix queued data handling on rekey
e289238 SFTPStream: stricter object value checks
0de75c7 SFTPStream: fix node v6.x support
6ecc420 SFTPStream: update Read/WriteStream implementation
053983a SFTPStream: fix conditional
fadce60 test: fix failing test on node v12
f8482fc SSH2Stream: fix server-side zlib@openssh.com compression
Additional commits viewable in compare view




